import React, {useEffect, useState} from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import logo from './logo.svg';
import './App.css';
import axios from 'axios'
import moment from 'moment'

import Admin from "./Admin"
import One from "./One"
import OneA from "./OneA"
import OneB from "./OneB"
import Two from "./Two"
import TwoA from "./TwoA"
import TwoB from "./TwoB"

const App = () => {

  const [ reload, setReload ] = useState(false)

  console.log("reload", reload)

  return (
    <Switch>
        <Route path="/" render={()=><Admin reload={reload} setReload={setReload}/>} exact />
        <Route path="/1" render={()=><One setReload={setReload} />} />
        <Route path="/1a" render={()=><OneA setReload={setReload} />} />
        <Route path="/1b" render={()=><OneB setReload={setReload} />} />
        <Route path="/2" render={()=><Two setReload={setReload} />} />
        <Route path="/2a" render={()=><OneA setReload={setReload} />} />
        <Route path="/2b" render={()=><OneB setReload={setReload} />} />
    </Switch>
  );
}

export default App;
